import { useState } from "react";

export default function Form() {
  const [page, setPage] = useState(0);

  const FormTitles = [
    "Login",
    "Sign Up",
    "Dashboard",
    "First Login",
    "First Login 2/2.",
  ];

  return (
    <div className="form">
      <div className="form-container">
        <div className="formHeader">
          <h1>{FormTitles[1]}</h1>
        </div>
        <div className="formBody"></div>
      </div>
      <div className="form-pages">
        <button>Prev</button>
        <button>Next</button>
      </div>
    </div>
  );
}
